import "./App.css";

let itemQuantity = 1;

function product(item, price, color, fill, quantity) {
  this.item;
  item, this.price;
  price, this.color;
  color, this.fill;
  fill, this.quantity;
  itemQuantity;
}

// const couchPillow = new item("Couch Pillow", "$89", color, fill, itemQuantity);
